import React, { useState,useEffect } from "react";
import './Header.css'
import {Link} from 'react-router-dom'
import Button from '@mui/material/Button';
import SearchIcon from '@mui/icons-material/Search'
import LocationCityOutlined from "@mui/icons-material/LocalActivityOutlined";


const Header = () => {
    return(
    <section class="header">
    <a href="#" class="logo">2T Store<span>.</span></a>
    <nav class="navbar">
        <Button><Link to={'/'}>Home</Link></Button>
        <Button><Link to={'/Listing'}>Shop</Link></Button>
        <Button><Link>Giới Thiệu</Link></Button>
        <Button><Link>Liên Hệ</Link></Button>
        <Button><Link to={'/Blog'}>Blog</Link></Button>
        <Button><Link>Đăng Ký/Đăng Nhập</Link> </Button>
    </nav>
    <div class="icons">
        <a href="#" class="fas fa-heart"></a>
        <a href="#" class="fas fa-shopping-cart"></a>
        <a href="#" class="fas fa-solid fa-user"></a>
    </div>
</section>
    );
}
export default Header;
